import React, { Component } from "react";
import BaseDataSection from "../../sections/report/baseDataSection";
export default class BaseDataLatinPage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.notificationSystem = React.createRef();
  }

  render() {
    return (
      <>
        <BaseDataSection isLatin={true} />
      </>
    );
  }
}
